Aytek is a &lt;a href="Turkish%20language"&gt;Turkish&lt;/a&gt; &lt;a href="masculine"&gt;masculine&lt;/a&gt; given &lt;a href="Turkish%20name"&gt;name&lt;/a&gt;. The name is composed by one &lt;a href="word"&gt;word&lt;/a&gt; and a &lt;a href="suffix"&gt;suffix&lt;/a&gt;: "Ay" and "-tek". In Turkish, "Ay" means &lt;a href="Moon"&gt;Moon&lt;/a&gt;, and the suffix, "-tek" originally comes from &lt;a href="Old%20Turkic%20language"&gt;Old Turkic&lt;/a&gt; suffix "-teg", which gives the meaning of "-like". The meaning of the name therefore is "like the Moon" or "Moonlike", or particularly "unique and/or bright like the Moon".
